    navbar: {
    
      width: "80%",
      color:"black",
      display: "flex",
      alignItems: "center",
      backgroundColor:"yellow",

    },

  }));

  const classes = useStyles();
  return (
    <div className={classes.navbar}>
      <ul>
        <li>
          ClubsHub
        </li>
        <li>
        Where passions unite, clubs ignite!
        </li>
        <li>
       
